tables.table_schema:
CREATE TABLE user_feedback (
    feedback_id INT PRIMARY KEY,
    user_id INT,
    feedback_date DATE,
    feedback_text TEXT
);

CREATE TABLE user_activity (
    user_id UUID PRIMARY KEY,
    last_login TIMESTAMP,
    total_interactions INT,
    total_time_spent INTERVAL
);

CREATE TABLE user_feedback (
    feedback_id UUID PRIMARY KEY,
    user_id UUID,
    feedback_text TEXT,
    feedback_rating INT
);

CREATE TABLE platform_performance (
    platform_id UUID PRIMARY KEY,
    total_users INT,
    total_interactions INT,
    avg_interaction_time INTERVAL
);

CREATE TABLE user_interaction_records (
  user_id INT,
  interaction_type VARCHAR(50),
  timestamp TIMESTAMP,
  platform VARCHAR(50)
);

CREATE TABLE user_data (
  user_id INT,
  name VARCHAR(50),
  email VARCHAR(50),
  age INT
);

CREATE TABLE platform_data (
  platform_id INT,
  platform_name VARCHAR(50),
  total_interactions INT
);

CREATE TABLE analysis_results (
  analysis_id INT,
  interaction_type VARCHAR(50),
  insights TEXT,
  recommendations TEXT
);
